package com.tongmeng.alliance.dao;

public class Apply {
	String key;
	String values;

	public String getKey() {
		return key;
	}

	public void setKey(String key) {
		this.key = key;
	}

	public String getValues() {
		return values;
	}

	public void setValues(String values) {
		this.values = values;
	}

	public Apply() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Apply(String key, String values) {
		super();
		this.key = key;
		this.values = values;
	}

}
